// Start the game
function startGame() {
    selectedGrade = document.getElementById('grade-selection').value;
    currentSet = getRandomSet(selectedGrade); // Get a random set of questions
    document.getElementById('start-screen').style.display = 'none';
    document.getElementById('game-screen').style.display = 'block';
    displayRandomQuestion();  // Show the first random question from the selected set
    // Enable keyboard input for the answer
    document.addEventListener('keydown', handleKeyPress);
   
    // Start the timer
    startTimer();
}

// Get a random set from the grade's question data
function getRandomSet(grade) {
    const sets = questionData[`grade_${grade}`]; // Get all sets for the selected grade
    const randomSetIndex = Math.floor(Math.random() * sets.length); // Pick a random set
    return [...sets[randomSetIndex]];  // Return a copy of the random set
}

// Display a random question from the current set
function displayRandomQuestion() {
    if (currentSet.length === 0) {
        alert(`You've finished this set of questions! Your final score is: ${score}`);
        currentSet = getRandomSet(selectedGrade); // Get a new random set
        displayRandomQuestion();  // Show a question from the new set
        return;
    }

    const randomIndex = Math.floor(Math.random() * currentSet.length);
    currentQuestion = currentSet[randomIndex];  // Set the current question
    currentSet.splice(randomIndex, 1);  // Remove the selected question from the pool

    const questionElement = document.getElementById('question');
    questionElement.textContent = currentQuestion[0]; // Show the random question
    currentAnswer = ''; // Reset the current answer
    updateAnswerDisplay(); // Clear answer display
}

// Handle key press for answer input
function handleKeyPress(event) {
    const key = event.key;
   
    // Allow only numbers and backspace
    if (key >= '0' && key <= '9') {
        currentAnswer += key;  // Append the typed number to the answer
        updateAnswerDisplay(); // Update the displayed answer
    } else if (key === 'Backspace') {
        currentAnswer = currentAnswer.slice(0, -1);  // Remove last character on backspace
        updateAnswerDisplay(); // Update the displayed answer
    }
   
    // Check if the answer is correct
    if (currentAnswer === currentQuestion[1].toString()) {
        score++;
        document.getElementById('score-value').textContent = score;
        displayRandomQuestion();  // Show a new random question after a correct answer
    }
}

// Update the visible answer display
function updateAnswerDisplay() {
    const answerDisplay = document.getElementById('answer-display');
    answerDisplay.textContent = currentAnswer; // Show current input
}

// Timer logic
function startTimer() {
    // Start the countdown
    timerInterval = setInterval(() => {
        timeLeft--;
        document.getElementById('timer').textContent = `Time Left: ${timeLeft}s`;

        // Stop the timer when it reaches 0
        if (timeLeft <= 0) {
            clearInterval(timerInterval);
            alert(`Time's up! Your final score is: ${score}`);
            resetGame();
        }
    }, 1000); // Decrease the timer every second
}

// Reset the game after completion
function resetGame() {
    clearInterval(timerInterval); // Clear the timer
    currentSet = [];
    score = 0;
    timeLeft = 120; // Reset the timer to 120 seconds
    document.getElementById('score-value').textContent = score;
    document.getElementById('timer').textContent = `Time Left: ${timeLeft}s`;
    document.getElementById('start-screen').style.display = 'block';
    document.getElementById('game-screen').style.display = 'none';
}
